type GreetProps = {
    name:  string
    messageCount: number
    isLoggedIn: boolean
}

export const Greet = (props: GreetProps) => {
  return (
    <div>
        {
            props.isLoggedIn
        }
        <h2>Welcome {props.name} You have {props.messageCount} unread meassages</h2>
    </div>
  )
}
